import React from "react";

const services = [
  { name: "Online Consultation", description: "Talk to a doctor from anywhere." },
  { name: "Appointment Booking", description: "Book appointments hassle-free." },
  { name: "E-Prescriptions", description: "Get digital prescriptions instantly." },
];

const Services = () => {
  return (
    <section className="w-full px-8 py-20 bg-gray-50 text-center">
      <h2 className="text-4xl font-bold text-gray-800">Our Services</h2>
      <div className="mt-10 grid grid-cols-1 md:grid-cols-3 gap-12 max-w-6xl mx-auto">
        {services.map((service, index) => (
          <div key={index} className="p-8 bg-white rounded-xl shadow-md hover:shadow-xl transition-all duration-300">
            <h3 className="text-2xl font-bold">{service.name}</h3>
            <p className="text-gray-600 mt-4 text-lg">{service.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Services;
